import React from "react";
import Button from '@mui/material/Button';


const CreateNote = () => {
  return(
    <>
      <div className="main_note">
        <form>
            <input type="text" placeholder="title" />
            <textarea cols="" rows="" placeholder="Take a note" />
            <Button/>
        </form>
      </div>
    </>
  )
}


export default CreateNote;
